import{_ as a,c as e,o as t,a1 as r}from"./chunks/framework.BwTyoF0R.js";const m=JSON.parse('{"title":"问题总结","description":"","frontmatter":{},"headers":[],"relativePath":"模拟面试-wiki/01-课程内容/03-托雷特/04-问题总结.md","filePath":"模拟面试-wiki/01-课程内容/03-托雷特/04-问题总结.md"}'),o={name:"模拟面试-wiki/01-课程内容/03-托雷特/04-问题总结.md"},i=r('<h1 id="问题总结" tabindex="-1">问题总结 <a class="header-anchor" href="#问题总结" aria-label="Permalink to &quot;问题总结&quot;">​</a></h1><h2 id="迟到-1-分钟" tabindex="-1">迟到 1 分钟 <a class="header-anchor" href="#迟到-1-分钟" aria-label="Permalink to &quot;迟到 1 分钟&quot;">​</a></h2><p>迟到是大忌，哪怕只有 1 分钟。程序员大都很较真，很有时间观念。（性能优化都看 s ms 级别，能不较真吗？）</p><p>按理说，应该提前 5 分钟到场。</p><h2 id="个人介绍没准备好" tabindex="-1">个人介绍没准备好 <a class="header-anchor" href="#个人介绍没准备好" aria-label="Permalink to &quot;个人介绍没准备好&quot;">​</a></h2><p>光说个人履历，没说技术栈和项目</p><h2 id="忘了" tabindex="-1">忘了！！！ <a class="header-anchor" href="#忘了" aria-label="Permalink to &quot;忘了！！！&quot;">​</a></h2><p>面试是很重要的事情，要提前准备，刻意练习，刷面试题，不能临场忘了。</p><p>必考题如果忘了，就说明没准备好，对此不重视。</p><p>面试这么大的事儿都不重视，工作中你能重视什么呢？</p><h2 id="项目介绍的问题" tabindex="-1">项目介绍的问题 <a class="header-anchor" href="#项目介绍的问题" aria-label="Permalink to &quot;项目介绍的问题&quot;">​</a></h2><p>第一，没有技术思维，只说项目的功能，没说技术栈和技术成就</p><p>第二，不会总结难点。</p><ol><li><p>因为是课程项目，自己就跟着课程开发，所以遇到的问题都是一些开发上的小问题：如写错了、忽略了什么配置等 —— 所以感觉这不是难题，这很低端。 我的建议是：可否通过一些工具和流程来规避这些问题？ 这就是很值得说的事儿</p></li><li><p>还有，因为是课程项目，自己没经历过项目全流程，所以项目难题只能限于开发阶段，而体会不到其他（设计、测试、上线、统计、运维）方面的。</p></li></ol><h2 id="不关注前端周边技术" tabindex="-1">不关注前端周边技术 <a class="header-anchor" href="#不关注前端周边技术" aria-label="Permalink to &quot;不关注前端周边技术&quot;">​</a></h2><p>WebAssembly 不知道</p><p>esbuild deno 都没听说过</p><h2 id="目标过高-执意追求大厂" tabindex="-1">目标过高，执意追求大厂 <a class="header-anchor" href="#目标过高-执意追求大厂" aria-label="Permalink to &quot;目标过高，执意追求大厂&quot;">​</a></h2><p>要正视自己的情况，目标过高完成不了，会使自己备受打击很颓废 （导致该学员一个多月没有学习动力）</p><p>不要收到网络信息的影响，生活并不是抖音看到的那样</p>',20),l=[i];function h(n,s,p,d,c,_){return t(),e("div",null,l)}const b=a(o,[["render",h]]);export{m as __pageData,b as default};
